def get_input():
    y, b, r = [int(x) for x in input().split()]
    return y, b, r


def get_output(y, b, r):
    return max(6, y + b + r)


def main():
    y, b, r = get_input()
    print(get_output(y, b, r))


if __name__ == '__main__':
    main()
